description:
Rocket from the Tombs (or RFTT) is an American rock music band originally active from mid-1974 to mid-1975 in Cleveland, Ohio.

Heralded as an important protopunk group, they were little known during their lifetime, though various members later achieved renown in Pere Ubu and the Dead Boys. Billy Bob Hargus wrote, however, that &quot;The sound of the Rockets is much more ferocious than Ubu or the Dead Boys.&quot;
